// src/components/Honeycomb.js
import React from 'react';
import './honeycomb.css';

const Honeycomb = ({ data }) => {
  return (
    <div className="honeycomb">
      {data.map((cell, index) => (
        <div key={index} className={`honeycomb-cell ${cell.difficulty}`} style={{ backgroundColor: cell.color }}>
          <div className="percentage">{cell.percentage}%</div>
        </div>
      ))}
    </div>
  );
};

export default Honeycomb;
